import React from 'react';
import {Line} from 'react-chartjs-2';

const LineGraph = ({lineData, historicalDeaths}) => {
    const data = {
        labels: ['September', 'October', 'November', 'December', 'January', 'February', 'March'],
        datasets: [
            {
                label: 'Deaths',
                fill: false,
                lineTension: 0.1,
                backgroundColor: 'rgba(75,192,192,0.4)',
                borderColor: 'rgba(75,192,192,1)',
                pointBorderColor: 'rgba(75,192,192,1)',
                data: historicalDeaths
            },
            {
                label: 'Active Cases',
                fill: false,
                lineTension: 0.1,
                borderColor: 'rgba(180,60,70,1)',
                pointBorderColor: 'rgba(75,192,192,1)',
                data: [15000, 200000, 500000,1000000,2000000,3000000,4000000]
            }
        ]
    };
    return(
        <Line data={data}/>
    )


}

export default LineGraph;
